Content:
• Processes are running instantiations of programs;
• Stored in RAM;
• Executable files found in storage.

• Includes necessary headers for shared memory; 
• Defines constants for size and name of shared memory object; 
• Opens shared memory object in read-only mode; 
• Maps shared memory object to process's address space; 
• Reads data from shared memory; 
• Unlinks (removes) shared memory object at the end.
